import Heading from '../components/Heading';
import Personal from '../components/Personal';
import Passion from '../components/Passion';
import Highlights from '../components/Highlights';

const index = () => (
  <Fragment>
    <Heading />
    <Highlights />
    <Personal />
    <Passion />
  </Fragment>
);

export default index;
